import React, { Component } from 'react'

export default class Chat extends Component {


    logicFunction = () => {
        if (this.props.message_conversation_id === this.props.conversation_id) {
            return this.props.sender, this.props.reciever
        }
    }


    render() {
        return (
            <div>
                {this.logicFunction()}
            </div>
        )
    }
}
